  false,\n\t\"url\": null,\n\t\"notes\": \"Hakalau Forest NWR (Hakalau) was established
  to conserve endangered forest birds and their habitats. Since establishment of the
  refuge there has been significant progress in forest restoration leading to increasing
  populations of native forest birds. However, these gains are threatened by invasion
  of exotic plants, animals and disease. English holly (Ilex aquafolia) was identified
  as a highest priority target invasive plant species in Hakalau Forest NWRu2019s
  2010 Comprehensive Conservation Plan (CCP). It is a tall shrub or small tree that
  can spread via seeds or vegetatively and can out-compete native species. Holly was
  originally planted around ranch buildings located in this area prior to establishment
  of the refuge. Currently it is mostly confined to the southwest portions of the
  refuge, but is spreading to other areas.  English holly produces berry which are
  eaten by native and non-native birds, leading to dispersal of seeds into previously
  non-invaded areas.  Hakalau Forest NWR is one of few places where English holly
  is found in Hawaii, so eradication here is crucial not only for the refuge, but
  for other native ecosystems in the state.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
